(1, 'Outdoor & Event Banners (Flexy Jerman)', 'data:image/jpeg;base64,', '<p>Produktivitas yang begitu tinggi serta membutuhkan mesin printer yang \ndapat mencetak dengan cepat, dibutuhkan sebuah printer yang mampu \nmemberikan benefit bagi pemiliknya, <strong>HP Latex 375</strong> hadir \ndengan ukuran 64 inch serta kecepatan cetak yang luar biasa hingga 91 \nm²/hr yang mampu mengejar produksi pencetakan Anda. Pengoperasian yang \nbegitu mudah serta dilengkapi sistem deteksi drop otomatis dan \npenggantian nozzel, tentu dapat menghemat biaya pemeliharaan (<em>cost reduction</em>).</p><p><strong>Printer HP Latex 375</strong> dibekali tinta berkapasitas 3 liter yang dapat menghemat biaya, dengan 7 warna tinta yang digunakan termasuk <em>HP Latex Optimizer</em>\n memberikan hasil cetak dengan warna yang spektakuler dan berkualitas \nserta tahan lama. Dengan jenis tinta hp latex yang digunakan printer \nini, hasil cetak untuk outdoor mampu bertahan hingga 5 tahun dengan \nlaminasi dan 3 tahun tanpa laminasi.</p><p><strong>Plotter HP Latex 375</strong> sudah dilengkapi <em>spectrophotometer</em>\n i1 embedded untuk membuat ICC profile serta memungkinkan kalibrasi \nwarna otomatis dan memberikan konsistensi warna yang seimbang. Dengan \nfitur baru <em>Remote Online Operating Training</em> yang begitu mudah, \nmemungkinkan Anda untuk melakukan pelatihan operator dari jarak jauh \nseperti memberikan arahan dasar bagaimana memulai pengoperasian printer \ndan lainnya, selain itu dengan adanya fitur baru <em>HP Quick Solutions App</em> memungkinkan Anda untuk dapat mengoptimalkan kualitas gambar langsung dari panel depan.</p>', 'outdoor-and-event-banners', 'outdoor-&-event-banners-(flexy-jerman)', 1, 1, '2020-08-15 09:03:38', '2020-08-15 09:03:38');

